import { useEffect, useState } from "react"


function Experts2(){

    const [experts,setExperts] = useState([])

    useEffect(function(){
        async function getExperts() {
            const data = await fetch("http://localhost:4000/experts")
            const expertsData = await data.json()
            setExperts(expertsData)
        }getExperts()
    },[])

    return (
        <>  
<h1 className="text-2xl font-semibold text-blue-800 mb-4">Expert 2</h1>
                <ul className="bg-blue-50 p-4 rounded-lg shadow-lg">
                    {experts.map((item, index) => (
                        <li key={index} className="text-blue-700 border-b border-blue-200 py-2 first:pt-0 last:border-b-0 last:pb-0">
                            ID: {item.id} | Nom Complet: {item.nom_complet}
                        </li>
                    ))}
                </ul>

        </>
    )
}

export default Experts2
